/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_employment_analysis` AFTER UPDATE ON `departments_students` FOR EACH ROW BEGIN
    IF OLD.college_name <> NEW.college_name THEN
        UPDATE employment_analysis SET college_name = NEW.college_name WHERE student_id = OLD.student_id;
    END IF;

    IF OLD.department_name <> NEW.department_name THEN
        UPDATE employment_analysis SET department_name = NEW.department_name WHERE student_id = OLD.student_id;
    END IF;

    IF OLD.major_name <> NEW.major_name THEN
        UPDATE employment_analysis SET major_name = NEW.major_name WHERE student_id = OLD.student_id;
    END IF;

    IF OLD.gender <> NEW.gender THEN
        UPDATE employment_analysis SET gender = NEW.gender WHERE student_id = OLD.student_id;
    END IF;

    IF OLD.date_of_birth <> NEW.date_of_birth THEN
        UPDATE employment_analysis SET date_of_birth = NEW.date_of_birth WHERE student_id = OLD.student_id;
    END IF;

    IF OLD.enrollment_year <> NEW.enrollment_year THEN
        UPDATE employment_analysis SET enrollment_year = NEW.enrollment_year WHERE student_id = OLD.student_id;
    END IF;
END */;;
