DROP TABLE IF EXISTS `employment_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `employment_info` (
  `employment_id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '就业信息ID',
  `student_id` bigint NOT NULL COMMENT '学生ID',
  `company_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '公司名称',
  `position` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '职位',
  `salary` decimal(10,2) DEFAULT NULL COMMENT '薪资',
  `employment_date` date DEFAULT NULL COMMENT '就业日期',
  `location` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '工作地点',
  `status` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '就业状态',
  PRIMARY KEY (`employment_id`) USING BTREE,
  KEY `employment_info_ibfk_1` (`student_id`),
  CONSTRAINT `employment_info_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `departments_students` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2341 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='学生就业信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

