/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_employment_analysis_after_info_update` AFTER UPDATE ON `employment_info` FOR EACH ROW BEGIN

    -- 检查并更新 employment_date 字段
    IF OLD.employment_date <> NEW.employment_date THEN
        UPDATE employment_analysis
        SET employment_date = NEW.employment_date
        WHERE employment_id = OLD.employment_id;
    END IF;

    -- 检查并更新 salary 字段
    IF OLD.salary <> NEW.salary THEN
        UPDATE employment_analysis
        SET salary = NEW.salary
        WHERE employment_id = OLD.employment_id;
    END IF;

    -- 检查并更新 location 字段
    IF OLD.location <> NEW.location THEN
        UPDATE employment_analysis
        SET location = NEW.location
        WHERE employment_id = OLD.employment_id;
    END IF;

    -- 检查并更新 employment_id 字段
    IF OLD.employment_id <> NEW.employment_id THEN
        UPDATE employment_analysis
        SET employment_id = NEW.employment_id
        WHERE employment_id = OLD.employment_id;
    END IF;

    -- 检查并更新 student_id 字段
    IF OLD.student_id <> NEW.student_id THEN
        UPDATE employment_analysis
        SET student_id = NEW.student_id
        WHERE employment_id = OLD.employment_id;
    END IF;

    -- 检查 status 字段的变化

    IF  OLD.status = '1' AND NEW.status = '0' THEN
        -- 如果 status 从 1 变为 0，则删除 employment_analysis 表中的相应记录
        DELETE FROM employment_analysis
        WHERE employment_id = OLD.employment_id;
    END IF;

END */;;
DELIMITER ;
